import React from 'react';
import './App.css';

import {Switch, Route, Redirect} from "react-router-dom";
import Paginate from "./pagination";

class App extends Component {
  render(){
    return (
      <div className="App">
        <Switch>
          <Paginate />
        </Switch>
      </div>
    );
  }
}

export default App;
